import { setDate, createId } from './'
import { Plant } from '../components'
import { GenericPlant } from '../gameObjects'

// Creates a new Plant, with a uniqueID, growth initialised at 0 and a new date

export default function createPlant(event, seed) {

  const position = {x: event.point.x, y: event.point.y, z: event.point.z}
  const plantData = new GenericPlant(createId(), setDate(), position)
  console.log("PLANT DATA")
  console.log(plantData)
  const newPlant = <Plant key={plantData.key} position={plantData.position} plantData={plantData} />
  console.log("New Plant")
  console.log(newPlant)

  return newPlant
}
